      value: '<p>Senior Technical Project Manager @<a href="https://www.teknorah.com" target="_blank">tekNorah</a> and Founder of the <a href="https://www.digitalcareersandbox.com/" target="_blank">Digital Career Sandbox</a></p><p>Meet <a href="https://about.me/tekNorah" target="_blank">tekNorah</a>, a seasoned pro with <a href="https://www.linkedin.com/in/teknorah/" target="_blank">15+ years</a> in software development and process improvement, excelling in education, government, and legal sectors.</p><p>A dedicated remote worker and mentor, tekNorah contributes to <a href="https://www.codementor.io/@teknorah" target="_blank">Codementor/Arc</a>, the <a href="https://www.drupal.org/u/teknorah" target="_blank">Drupal</a> <a href="https://drupal.slack.com/"  target="_blank">Slack</a> workspace, <a href="https://www.midcamp.org/"  target="_blank">MidCamp</a> leadership, and intern coordination at <a href="https://drupal4gov.us/" target="_blank">Drupal4Gov</a>, the fiscal host for <a href="https://www.drupalgovcon.org/" target="_blank">Drupal GovCon</a>. Their focus on collaboration and ideation boosts organizational performance.</p><p>Passionate about innovation, tekNorah''s meticulous approach to systems design and change management <a href="https://www.teknorah.com/resume" target="_blank">stands out</a>. Crafting <a href="https://www.behance.net/tekNorah" target="_blank">tailored solutions</a> and facilitating teams towards value-driven <a href="https://www.linkedin.com/in/teknorah/details/projects/" target="_blank">strategic initiatives</a>, their excellence is evident.</p>'
